import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

class AboutMe extends Component {
    render() {
        return(
            <div>
                <Container>
                    <Row>
                        <Col>
                            <h1 className="text-center">About Me</h1>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default AboutMe;
